['class Node:

    def __init__(self, val=None):
        self.val = val
        self.next = None

class LinkedList:

    def __init__(self):
        self.head = None

    def add(self, val):
        new_node = Node(val)
        if self.head:
            current = self.head
            while current.next:
                current = current.next
            current.next = new_node
        else:
            self.head = new_node

def funcImp(head):
    length = 0
    current = head
    while current:
        length += 1
        current = current.next
    return length']

